import React from 'react'
import Doc from "../doc/rib.pdf";
import Viewer from '../components/Viewer'

const Secondary = () => {
    return (
        <div className="min-h-screen bg-gray-200">
          <Viewer Doc={Doc}/>
        </div>
    )
}

export default Secondary
